import React from "react";
import CountdownTimer from "react-component-countdown-timer";

export default class Timer extends React.Component {
  render() {
    var settings = {
      count: 5432,
      border: true,
      showTitle: true,
      noPoints: true,
    };
    return <CountdownTimer {...settings} />;
  }
}
